import axios from 'axios'

export class GetRequest {
    static getHistory() {
        axios.get('/user?ID=12345')
            .then(function (response) {
                console.log(response.data);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            })
    }
}
